We can add effects to generics like <effect A: E>, and create bounds for the effects of types by doing effect E = A in the <..> list or the where-clause. The basic syntax is that effect async = true means the type is async, whereas effect async = false means it is not. For convenience we'd let effect async be the same as effect async = true and effect !async be the same as effect async = false. async fn foo would be syntactic sugar for fn foo<effect async = true>. and similar for other effects. So as an example, here are some equivalent ways of writing an async function: fn foo<T, O, const N: usize, effect async = true>(...) {...}
fn foo<T, O, const N: usize, effect async>(...) {...}
async fn foo<T, O, const N: usize>(...) {...}
fn foo<T, O, const N: usize>(...) where effect async {...} Every effect has a default value, and if there is no bound on the type for that specific effect it is assumed to have its default value. So the function above, having no bound on const, would be assumed not-const. This could be explicitly stated like async fn foo<T, O, const N: usize>(...) where effect !const {...} However this would be unneccesary. If a type has only one generic for an effect, and no other bounds for that effect. It is assumed to have the same bound as that one generic. Meaning the following are equivalent ways of making a function generic over async. fn foo<T, O, const N: usize, effect A: async>foo(...) where effect async = A {...}
fn foo<T, O, const N: usize, effect A: async>foo(...) {...} However if there are multiple generics, we'd need to explicitly state what the bound should be for the type itself. fn foo<T, O, const N: usize, effect A: async, effect B: async>foo(...) where effect async = A | B {...} This would mean that foo is async if either A is true or B is true. We could also use A + B if wanted it to be async whenever both are true. Declaring an type to have/not have an effect different from the default value might change the type. For instance fn foo<effect async>() -> T would become foo() -> Future<Output = T>. Every generic effect variable (except for<effect>) is also like a constant boolean value, which is true whenever the type is in a context where it has that effect, and false otherwise. In traits, the items are assumed to have the same effect bounds as the trait itself. But this can be overridden using specific bounds for that item. For instance trait Read<effect A: async> { // This function is now generic over async fn read(&mut self, buf: &mut [u8]) -> Result<usize>; // or equivalently fn read(&mut self, buf: &mut [u8]) -> Result<usize> where effect async = A; // This function is now always async async fn read(&mut self, buf: &mut [u8]) -> Result<usize>; // or equivalently fn read(&mut self, buf: &mut [u8]) -> Result<usize> where effect async; // This function now only exists when the trait is async fn read(&mut self, buf: &mut [u8]) -> Result<usize> where A;
} This also shows that unlike normal const _: bool we can actually use whether the generic effects are true/false in the where-clause.

